import React from 'react';
import Logo from "../../assets/images/logo.png";

import "./Header.scss";

const Header = () => {
	return (
		<div className="Header">
			<Link to="/"><img src={Logo} alt="" /></Link>
			<h1>Header</h1>
		</div>
	);
}

export default Header;
